import { PieceModel } from "./pieces/PieceModel";

export class SquareModel{
    private color:string;
    private pos:string;
    private piece:PieceModel | undefined;

    public constructor(color:string,pos:string,piece?:PieceModel){
        this.color = color;
        this.pos = pos;
        this.piece = piece;
    }
    public getPiece():PieceModel | undefined{
        return this.piece;
    }
    public getColor():string{
        return this.color;
    }
    public getPos():string{
        return this.pos;
    }
    public setPiece(piece:PieceModel | undefined){
        this.piece = piece;
    }
    public clone(): SquareModel {
        const clonedSquare = new SquareModel(this.getColor(), this.getPos());

        const piece = this.getPiece();
        if (piece) {
          const clonedPiece = piece.clone(); // Implement clone method in the Piece class
          clonedSquare.setPiece(clonedPiece);
        }

        return clonedSquare;
      }
}
